actionConfiguration.body:
() => {
  var questionId = '';
  let answers = appsmith.store.answers;
  console.log(answers);
  let questions = appsmith.store.questions;
  let mode = appsmith.store.mode;
  let currentAnswer = 0;
  let newQuestion = true;
  let lastQuestion = '';
  for (var answer of answers) {
    lastQuestion = answer[1];
    if (answer[8] == 'STARTED') {
      currentAnswer = answers.indexOf(answer);
      newQuestion = false;
      questionId = answer[1];
    }
  }
  ;
  if (newQuestion) {
    let nextQuestion = false;
    if (lastQuestion) {
      for (var question of questions) {
        console.log('question ' + question);
        if (nextQuestion) {
          nextQuestion = false;
          questionId = question;
        }
        if (question == lastQuestion) {
          nextQuestion = true;
        }
      }
      ;
    } else {
      console.log(questions);
      console.log(questions[0]);
      questionId = questions[0];
    }
    ;
    if (nextQuestion) {} else {
      let id = '4412241434';
      let questionStatement = '';
      let response = '';
      let responseOK = '';
      let start = Date.now();
      let end = Date.now();
      let status = 'STARTED';
      let data = {};
      let row = answers.push([id, questionId, questionStatement, response, response, responseOK, start, end, status, data]);
      storeValue('answers', answers);
      currentAnswer = row;
      storeValue('currentAnswer', currentAnswer);
    }
  }
  ;
  console.log(answers);
  let page = questionId;
  page = page.replaceAll("ñ", "n");
  page = page.replace(/[^\x00-\x7F]/g, "");
  page = page.replaceAll(" ", "-");
  page = page.replaceAll("--", "-").toLowerCase();
  console.log(questionId);
  console.log(page);
  console.log(appsmith.URL.pathname);
  console.log(mode);
  if (!appsmith.URL.pathname.includes(page) && mode == "production") {
    console.log("Navigate to: " + questionId);
    navigateTo(questionId);
  }
}

