  let respuestaCorrecta = qlowcode.getValue("cifra1") + qlowcode.getValue("cifra2");
  console.log(respuestaCorrecta);
  qlowcode.saveValue("respuesta1", respuesta.text);
  if (respuesta.text == respuestaCorrecta) {
    console.log("Correcto");
